Perlas Go - mobilioji programėlė lengvam ir patogiam sąskaitų apmokėjimui visoje Lietuvoje. Nebeieškokite kur ir kaip mokėti už periodines ir pavienes sąskaitas, nes su Perlas Go sumokėsite mokesčius už komunalines paslaugas net tik greitai ir saugiai, bet ir nemokamai, nes atsiskaitymams netaikomas paslaugos mokestis!

GREITAI IR LENGVAI ATLIEKAMI MOKĖJIMAI

- Už vandenį;
- Už dujas;
- Už elektrą;
- Už šildymą;
- Už kabelinę televiziją ir internetą;
- Už darželius;
- VMI;
- Sodrai.

KODĖL VERTA TURĖTI PERLAS GO
+ Sąskaitas už komunalines paslaugas apmokėkite be jokio paslaugos mokesčio;
+ Sąskaitas apmokėkite tiesiog jas nuskenuodami arba suvedę duomenis savarankiškai;
+ Mokėjimus atlikite tiek per e-banką, tiek grynaisiais pinigais Perlo terminaluose;
+ Sąskaitas ir mokesčius galima mokėti be papildomos tapatybės identifikacijos;
+ Mobiliojoje programėlėje raskite daugiau nei 2500 paslaugų teikėjų sąrašą;
+ Primename apie mokėtinas sąskaitas;
+ Pateikiame išsamią mokėjimų istoriją ir sąskaitų išklotines;
+ Paslaugų teikėjų mokėjimų duomenis atnaujiname periodiškai.
ORGANIZUOKITE SAVO SĄSKAITAS IR MOKĖJIMUS
+ Sukurkite neribotą mokėjimų sąrašų kiekį ir lengvai grupuokite sąskaitas juose;
+ Apmokėkite visą savo sukurtą mokėjimų krepšelį arba pavienes sąskaitas jame;
+ Kurkite periodinius mokėjimus

SAUGUMAS IR KONTROLĖ

Mes gerbiame savo klientų privatumą ir renkame tik būtiniausius duomenis, kurie yra tvarkomi ir saugomi pagal galiojančius duomenų apsaugos įstatymus. Perlas Go - mobilioji programėlė yra ne tik funkcionali ir patogi naudotis, bet ir atliekamų operacijų saugumo užtikrinimui yra taikomi aukšti apsaugos standartai.

PAGALBA

Perlas Go klientai – mūsų prioritetas. Jei turite klausimų, susijusių su Perlas Go programėle, susisiekite su mumis el. paštu: info@perlasgo.lt arba skambinkite į klientų aptarnavimo skyrių telefonu: +370 5 275 17 51.

Atsisiųskite Perlas Go - už mokesčius ir sąskaitas atsiskaitykite nemokamai ir be rūpesčių!

---------------------------------------------

PAY YOUR BILLS FAST & EASY

Perlas Go is a safe, simple, and helpful way to manage your recurring or one time bills without extra cost. With Perlas Go you can pay for utilities like water, gas, electricity, communication services like cable TV, internet, phone, also tolls for State Tax Inspectorate (VMI), State Social Insurance Fund (Sodra).

WHY YOU SHOULD HAVE PERLAS GO

+ You can pay all your bills without any extra cost;
+ It is convenient – you can scan barcodes on your bill or enter data yourself; also
+ we can renew data from supplier (service provided) about your payments periodically;
+ There is a large and constantly growing list of service providers (utilities, communications, state institutions, etc);
+ You can set up recurring payments;
+ You can pay all your bills at once or one at a time;
+ You can perform payment through e-bank, or pay in cash at Perlas terminal;
+ You can receive reminders about pending payments and see detailed history of payments.

Naudojantis nauja Šiaulių banko programėle galite greitai ir paprastai tvarkyti kasdienius finansus išmaniaisiais prietaisais. Pirminiame programėlės etape daugiausiai dėmesio skyrėme dažniausiai naudojamoms paslaugoms, vėlesniuose etapuose numatomas programėlės funkcijų plėtimas ir vystymas.  

Kviečiame susipažinti su programėlės funkcijomis ir išbandyti jas patiems: 

• Prisijungimas su „Smart-ID“ arba mobiliuoju parašu; 
• Greitasis prisijungimas su piršto atspaudu arba susikurtu PIN kodu; 
• Visų savo sąskaitų likučiai ir rezervuotos sumos; 
• Greitas pinigų pervedimas į savo sąskaitas; 
• Paprasti ir momentiniai pervedimai į kitus bankus; 
• Mokėjimai iš ruošinių arba gavėjų, įvedus tik tris raides gavėjo laukelyje; 
• Valiutos keitimas; 
• Pranešimai (angl. „push notification“) apie įplaukas į sąskaitą; 
• Paskutinių operacijų sąrašo peržiūra. 

Jūsų patogumui, programėlė yra pasiekiama lietuvių ir anglų kalbomis.

Pirmą kartą, kai prisijungsite naudodamiesi interneto banko prisijungimo priemonėmis, būsite paprašyti sugalvoti 4 skaitmenų PIN kodą, kuriuo galėsite greitai prisijungti prie programėlės. Taip pat prisijungimui galėsite naudoti piršto atspaudą.
