With the means of the new Šiaulių bankas app, you can quickly and easily manage your daily finances via smart devices. In the initial stage of the app, we focused on the most frequently used services, in the later stages it is planned to expand and develop the functions of the app.

We invite you to get acquainted with the features of the app and try them for yourself:

• Login with Smart-ID or mobile signature;
• Fast connection with a fingerprint or created PIN code;
• Balances and reserved amounts of all your accounts;
• Fast transfer of money to your accounts;
• Simple and instant transfers to other banks;
• Payments from drafts or recipients by entering only three letters in the recipient field;
• Currency exchange;
• Push notifications of account receipts;
• View of recent transactions list.

For your convenience, the app is available in Lithuanian and English.

The first time you log in using the online banking login tools, you will be asked to come up with a 4-digit PIN code that will allow you to quickly connect to the app. You will also be able to use a fingerprint to sign in.

